INSERT INTO `Order_items` VALUES (1,1,1,'棒棒糖-待審查','1','https://i.imgur.com/05CXT8U.jpg','棒棒棒',1,20000,1,'2021-04-22 04:43:52','2021-04-22 04:43:52',NULL),(2,278,2,'CaoJunNFT Collectibles #0003','1','https://i.imgur.com/PFJhvH4.jpg','CaoJunNFT Collectibles #0003\n\nEdition No.: 8272818830000003\n\nTotal Edition Released:600\n\nOwner: TSA Collections\n\nCaoJunNFT\'s collection features four Caojun Digital Collectibles. Each collectible features one of CaoJun\'s artwork with a size of 3.5inch X 2 inch. The designs of the Cao Jun Digital Collectibles are based on three of Cao Jun\'s artworks \"Purple Pavilion and Cyan Cloud\", \"Once in a Millennium,\" and \"Spring\'s News\". The painting of \"Once in a Millennium\" was sold for HK$10.26 million at Poly Auction Hong Kong Limited in 2019. The collection of CaoJun Digital NFT Collectible has sold for a total of US$5,374 on April 16, 2021 at Bakery Gallery.\n\nCao Jun Digital Collectible is an NFC-enabled digital wallet card powered by Pundi X and iCashRewards. The Cao Jun exclusive digital wallet card managed by XWallet can be used as a present and your own personal digital wallet. The Cao Jun exclusive digital wallet card is an easy-to-use tap card for crypto beginners. Top it up with your preferred digital currencies and pay with ease. You can also pair your Cao Jun digital wallet card onto the XWallet mobile app and use it with the iCash XPOS. There are over 800,000 XWallet registered user accounts within the Pundi X community from over 30 countries spanning across North and South America, the EU, Asia, and Australia. The XWallet can be downloaded from the App Store and Google Play.\n\nBy collecting CaoJunNFT, users can also use CaoJun NFT to farm $TSA or CJAI or iCASH and can be traded on the TSA NFT Broadway. Users are able to redeem the completed NFT for a physical digital collectible. \nOne CaoJunNFT can be converted into one exclusive CaoJun limited edition of a digital collectible (\"CaoJun Digital Collectible\"). The total released CaoJunNFT collectibles in 2021 is 600 editions, and will be scheduled to auction from May 1, 2021 on various NFT auction platforms curated by TSA Collections.\n\nPlease contact support@teaswap.art if you have any questions.\n\n',1,100,0,'2021-06-25 10:35:12','2021-06-25 10:35:12',NULL),(3,280,3,'Shih NFT #10 Eyes','6','https://i.imgur.com/sIgTM13.gif','Shih NFT #10 Eyes\nCreator: TSA NFT Studio',1,110,0,'2021-06-25 15:10:51','2021-06-25 15:10:51',NULL),(4,280,4,'Shih NFT #10 Eyes','6','https://i.imgur.com/sIgTM13.gif','Shih NFT #10 Eyes\nCreator: TSA NFT Studio',1,110,0,'2021-06-25 15:22:07','2021-06-25 15:22:07',NULL),(5,281,5,'simon aaaa','2','https://i.imgur.com/C1cItwt.jpg','aaaaaaa',1,100,0,'2021-06-25 16:01:41','2021-06-25 16:01:41',NULL),(6,282,6,'ShihNFT #12 Skipping','6','https://i.imgur.com/XKgLzCJ.gif','ShihNFT #12 Skipping',1,105,0,'2021-06-25 16:37:13','2021-06-25 16:37:13',NULL),(7,282,7,'ShihNFT #12 Skipping','6','https://i.imgur.com/XKgLzCJ.gif','ShihNFT #12 Skipping',1,105,0,'2021-06-25 16:41:28','2021-06-25 16:41:28',NULL),(8,273,NULL,'ShihNFT #5 S-tail #5','6','https://i.imgur.com/KrEsfyH.gif','ShihNFT #5 S-tail #5\nCreator: TSA NFT Studio',1,100,0,'2021-06-26 02:31:32','2021-06-26 02:31:32',NULL),(9,284,9,'CJAI NFT#003','1','https://i.imgur.com/dE45vc8.png','CaoJunNFT\'s collection features four Caojun Digital Collectibles. Each collectible features one of CaoJun\'s artwork with a size of 3.5inch X 2 inch. The designs of the Cao Jun Digital Collectibles are based on three of Cao Jun\'s artworks \"Purple Pavilion and Cyan Cloud\", \"Once in a Millennium,\" and \"Spring\'s News\". The painting of \"Once in a Millennium\" was sold for HK$10.26 million at Poly Auction Hong Kong Limited in 2019. The collection of CaoJun Digital Collectible has sold for a total of US$5,374 on April 16, 2021 at Bakery Gallery. \n\nCao Jun Digital Collectible is an NFC-enabled digital wallet card powered by Pundi X and iCashRewards. The Cao Jun exclu