精緻的文學質感，值得所有讀者傳家珍藏！',150,1,'1','新北市',7,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(124,1,2,0,'8天重新認識JavaScript','https://i.imgur.com/bgSxxVcl.jpg','缺封皮，但不影響閱讀。本書內容是由作者在2018 iT邦幫忙鐵人賽 -「重新認識JavaScript」的系列文章改寫而成，主要針對剛接觸JavaScript或者對JavaScript不是那麼熟悉的讀者，說明JavaScript的基礎與常見的誤區。',180,1,'1','高雄',2,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(125,1,3,0,'重構：改善既有程式的設計','https://i.imgur.com/CgXnZTm.jpg','這本書只看一次左右。書籍簡介：二十多年來，世界各地經驗豐富的程式員都使用Martin Fowler的《重構》來改善既有程式的設計、提升軟體的易維護性，以及讓既有的程式更容易被人瞭解。為了反映程式設計領域的重大變化，作者全面翻新書籍內容，推出這本備受期待的新版本。《重構 第二版》提供了新的重構名錄，加入JavaScript範例程式以及新的實用範例來展示各種重構。這個版本與第一版一樣，將解釋什麼是重構、為何重構、如何認出需要重構的程式，以及如何成功地重構，無論你是使用哪一種語言。',300,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(126,1,4,0,'在黑洞中我看見自己的眼睛','https://i.imgur.com/pcrAbfU.jpg','近全新，附作者簽名。書本介紹：青年詩人徐珮芬從日常的語言中凝聚出簡單的詩句，調皮的意象跳躍在文字之間，天馬行空的想像帶來意想不到的閱讀驚喜。書中收錄新銳插畫家吳睿哲為每一首詩創作的插畫，襯托詩人細膩的內心世界。',800,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(127,1,5,0,'滌這個不正常的人','https://i.imgur.com/h11OVw4.jpg','超級好看，大推，簡介：這是一篇描繪家庭情感的長散文，一份記錄困難關係的報導，一部近身拍攝的紙上紀錄片。作者書寫時，沒有預設，無從計畫，她不知道會如何發展，更不知道終點在哪裡，只能「且走且看」的記錄下這一切，並盡可能誠實。或許正因為如此，才更顯真實。不雕鏤文字，卻總是精準切中；不渲染情感，反因為節制而動人；沒有高潮起伏，仍引領讀者一路讀下去。那些層疊細碎的家庭日常，讓我們無比熟悉；每個家人的現實處境，與我們這般接近。',250,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(128,1,6,0,'從 Hooks 開始，讓你的網頁 React 起來','https://i.imgur.com/Q2RQJPe.jpg','Hook 入門很棒的一本書，推薦給大家。',300,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(129,1,7,0,'行銷管理(15版)','https://i.imgur.com/svYilJe.jpg','台大管理學指定課本，近全新，書籍簡介：如何在快速變動的科技發展時代掌握行銷的趨勢脈動，是頂尖行銷人員不可或缺的技能。當代行銷學之父、美國西北大學凱洛管理學院名譽教授Philip Kotler所著之《行銷管理》一書自1967年第一次出版以來，即成為國際各頂尖商管學院最常使用的教材，更被英國《金融時報》評選為史上最偉大的商管書籍之一，是有志成為優秀行銷人士必讀的經典。',400,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(130,1,8,0,'賈樟柯電影手記','https://i.imgur.com/hJFRucx.jpg','賈樟柯的電影筆記，內容不錯，近全新。',100,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(131,1,9,0,'複眼人','https://i.imgur.com/JlHdkHG.jpg','珍藏多年的書半價售出，讀過幾本吳明益的小說，在他臉書結束貼文前也長期追蹤。總是喜愛閱讀吳明益，而在所有作品裡，最喜歡的就屬《複眼人》了。',180,1,'1','台北',3,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(132,1,10,0,'家離水邊那麼近','https://i.imgur.com/eaa0rGu.jpg','書不在家中，在台南老家，如果有下單請等候我週末回台南才可以寄出。本書是自然寫作者吳明益繼2003年出版的《蝶道》之後的動人作品。喜歡自然寫作的人對《蝶道》應該不陌生，這是一本十分動人的生態散文，出版後即獲得讀者和書評家們的一致擁戴和好評，不但叫座也叫好。獲得該年度中時的十大好書獎同時也獲選為金石堂該年度最具影響力的好書之一。沈寂四年後再推出的《家離水邊這麼近》更是叫人驚艷。本書是吳明益這四年間，流連在溪邊、湖邊、和海邊的生活、行走、坐臥觀察、反思和記錄的動人創作。',200,1,'1','台北',10,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(133,1,11,0,'再見楊德昌','https://i.imgur.com/4Mvcru9.jpg','楊德昌影迷必買，僅此一本。本書深度專訪十六位曾與楊德昌共事的電影人——小野、吳念真、柯一正、余為彥、舒國治、杜篤之、廖慶松、陳博文、張惠恭、鴻鴻、陳以文、王維明、陳駿霖、金燕玲、張震、柯宇綸。他們涵蓋了制片、導演、編劇、錄音師、剪輯師、攝影師、演員等多重身份。他們或是以友人的立場發聲，或是從師徒的關系出發，抑或循着個人的專業提出見解，情理交織，全面回顧了楊德昌的創作生涯，多側面、立體式地還原了這位電影哲人及其作品。藉由這些所網羅的珍貴的第一手史料，藉由這些走過台灣新電影的資深電影人對那段相濡以沫的美好時光的追憶、緬懷與思索，揭開了台灣電影史上異常動人的一頁，為熱愛台灣電影的人們留下了珍貴的時代記錄，也為讀者親近楊德昌電影作品獨辟了一條非凡的蹊徑。',400,1,'1','台北',2,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(134,1,12,0,'愛何必百分百','https://i.imgur.com/3ZovLlV.jpg','我們何必用許多假設，甚至設計各種方法，去驗證自己的愛人？我們可以心裡知道，愛情有深淺、性格有剛柔、每個人看待事情的態度也不同，所以到了緊要關頭，身邊人可能棄我們而去。但是今天、現在－－他閃亮、他堅強、他溫柔，如同百分之百的真鑽，就當他是真鑽吧！就在太平歲月，快快樂樂，相依相偎過一生吧！',90,1,'1','台北',2,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(135,1,13,0,'鯨背月色','https://i.imgur.com/Vkpgci6.jpg','吳明益老師推薦，他的啟蒙讀物。書籍介紹：跟隨美國著名博物學家一起觀察、發現、認知迷人的自然世界與動物。在幽深的山洞里觀察2000萬只倒掛着的蝙蝠、在北美古城聖奧古斯丁鱷魚農場捕捉鱷魚、在大海里聽鯨魚唱歌、乘船去南極了解很通人性的動物——企鵝。戴安娜·阿克曼對生命的激情與活力令我們動容。她遭到過鱷魚的攻擊，游進過鯨魚嘴里，攀登過峭壁，也嘗過極地寒風凜冽的滋味，卻仍然認為所有的生命都是那麼的迷人，這些經歷讓她收獲了特別的東西，關乎自然，也關乎人類處境。',190,1,'1','台北',2,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(136,1,14,0,'人生的四大秘密','https://i.imgur.com/c4i2PfR.png','我也不知道是什麼書，家裡書櫃發現的。書本簡介：本書收藏了四十個不可思議的奇遇故事。故事的主人公是一位神祕的中國老人，他將帶給你四十個幸運心法。啟發你運用與生俱有的內在力量，活出幸福的人生！翻開這本書，你的人生就有了逆轉勝的可能。',60,1,'1','台北',2,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(137,1,15,0,'想我眷村的兄弟們','https://i.imgur.com/XOO88gQ.jpg','媽媽的書，她不看了所以賣掉。書本介紹；《想我眷村的兄弟們》為在城市裡散落、在記憶中淡去的族群留下一個無須質疑立場的口述歷史記錄。當信仰逐漸化約成教條，當所謂的選擇只能經過唯一的真理標準檢驗，當文學幾乎被所有人忽略它最重要的價值，我們不能忘記朱天心曾以這樣的筆和勇氣書寫過台灣。',140,1,'1','台北',7,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(138,1,16,0,'如何讓馬飛起來：物聯網之父創新與思考的9種態度','https://i.imgur.com/M9WPos3.jpg','老師送的書，全新沒看過，缺錢買遊戲。書本介紹：「想激發創意潛能，讀這本書就夠了！」讀了這本書，每個人都會變得更聰明，還會讓馬飛起來',60,1,'1','基隆',1,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(139,1,17,0,'淡江記','https://i.imgur.com/e2nZ5jC.jpg','朱天文五年前送我的書，附作者簽名以及我和她的合影。本書為朱天文散文集，多為記述淡江大學的同輩交往情誼、創辦三三書坊的過程，以及「沒有名目的大志」。',600,1,'1','苗栗',10,'0',NULL,'0',NULL,'2021-04-22 04:43:52','2021-04-22 04:43:52',0,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',NULL,NULL,1,0),(140,1,18,0,'圖解第一次買股票就上手','https://i.imgur.com/eQQvK0Y.jpg','感謝這本書讓我賺到五套房。介紹：本書以淺顯易懂的語言，從股票市場的基本概念談起，循序漸進地介紹選股的步驟、判斷行情時機的方法、買賣時必須注意的細節、計算獲利的方式，並提供