://i.imgur.com/Hdep20K.jpg','“TV Eyes”\nBy DAN BALDWIN\nSigned limited edition silkscreen print with gold leaf, diamond dust and glazes\nPublished 2013, edition of 100\n\nPrints, Silkscreen\nH 96 cm x W 95 cm\nEdition: 25 of 100\n\nBy collecting this NFT, the buyer is able to redeem the completed NFT for physical artwork.',10.99,1,'0','0x0164E4888F3ae34731B9f04562E6B375538556cC',0,'0','','0',NULL,'2021-06-24 06:55:18','2021-06-24 06:56:27',1000,'0x0000000000000000000000000000000000000000','Picture',4,NULL,1,0),(271,2,263882,0,'“Anomie”','https://i.imgur.com/fWLTuUu.jpg','“Anomie”\nsigned limited edition silkscreen print with gold leaf, embossing and glazes by Dan Baldwin.\n\nPrints, Silkscreen\nImage Size: 1010 x 1015mm\nPaper Size: 1190 x 1200mm\nPublished: 2015\nEdition: 71 of 75\nBy collecting this NFT, the buyer is able to redeem the completed NFT for physical artwork.\n\nAnomie. Noun.\n1. Social instability caused by erosion of standards and values.\n2. Alienation and purposelessness experienced by a person or a social group as a result of a lack of standards, values or ideals.\n\n‘I wanted to combine elements of two previous prints that I have made; the tone and warmth of Love (2012) and the dynamism of the neutron-like exploding circle motif in Cyclone (2011). This work is contradictory; the happy warm colour draws you in, but the imagery is dark and disconcerting- reflecting the instability and sense of dislocation of the state of anomie. Natural elements v. manmade objects, innnocence v. corruption, security v. conflict, religion v. pantheism, ornament v. rawness, youth v. decay- I am exploring all of these juxtapositions.’\n\nDan Baldwin\nDan Baldwin’s busy prints are a clash of colour and symbol. The Manchester-born artist draws on pop art and collage as well as the older Dutch-style painting of the seventeenth century. Motifs like the flower, the skull, the bird and rotting fruit were recognisable symbols of life, death and mortality in their day. What Dan aims to do is revitalise these symbols for a contemporary audience. We love the hyper-modern look that the artist achieves through his layers of paint and multimedia.\n\nDan trained at Eastbourne College of Art, continuing his studies thereafter at Kent Institute of Art. Over the course of his career, Dan has exhibited a number of sold-out solo shows in London and the US. In 2008, Dan’s ‘Apocalypse Wow – The End of Everything’ sold at Bonhams for over £25, 000.\n\nThe artist’s work is in the permanent collections of The Groucho Club and Café Royal. Individual collectors of his work include Sir Ronald Cohen, Bernie Ecclestone and Damien Hirst. Dan is also known for his collaborations with Max Factor, Sara Berman and Paolo Nutini.\n\n\n',10.99,1,'0','0x2595Ac0a27dA82eF504D986B9d0fa954f4971d16',0,'0','','0',NULL,'2021-06-24 19:34:31','2021-06-24 21:22:34',2000,'0x0000000000000000000000000000000000000000','Picture',0,1,1,0),(272,6,263885,0,'ShihNFT #4 S-ear ','https://i.imgur.com/08feGGA.gif','ShihNFT #4 S-ear\nCreator: TSA NFT Studio\n',5000,1,'0','0x2D2EA8Ff170407Ec26dd8F1C6854a84af9DD4118',0,'0','','0',NULL,'2021-06-24 21:02:46','2021-06-24 21:04:28',2000,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',0,NULL,1,0),(273,6,262534,0,'ShihNFT #5 S-tail #5','https://i.imgur.com/KrEsfyH.gif','ShihNFT #5 S-tail #5\nCreator: TSA NFT Studio',100,0,'0','0x2D2EA8Ff170407Ec26dd8F1C6854a84af9DD4118',0,'0','','0',NULL,'2021-06-25 05:40:23','2021-06-26 02:31:32',1000,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',1,NULL,1,0),(274,6,262534,0,'ShihNFT #2 S-head','https://i.imgur.com/zix6fXR.gif','ShihNFT #2 S-head\nCreator: TSA NFT Studio',100,1,'0','0x2D2EA8Ff170407Ec26dd8F1C6854a84af9DD4118',0,'0','','0',NULL,'2021-06-25 05:54:33','2021-06-26 02:31:32',1000,'0x5f99ACF13CAff815DD9cB4A415c0fB34e9F4545b','Picture',3,NULL,1,0),(275,5,263882,0,'TSA Broadway #26 FU7UR3','https://i.imgur.com/0LMQngh.gif','TSA Broadway #26 FU7UR3 Broadway\nCreator: Cosmic Bee\n\nTSA NFT S