.\n$Shih can be used at Shih Tzu NFT Caffe Shop or redeem Shih NFT collectibles.',NULL,NULL,NULL,NULL,'https://i.imgur.com/VOsktPY.jpg','https://i.imgur.com/WlCfgy1.jpg',0,NULL,'2021-06-20 05:11:42','2021-06-28 02:16:15',56,'','','','','','','','','',1,1),(263802,'56_0x5F8b706DB4B2FC2191862021cC61183087924D93','$2b$10$EiLK2qMY44tmH3SkWVddUOpxXStChjgTdFiROXd4/KMDTDJJwpPyS','CJAI TEST NFT1',NULL,'0x5F8b706DB4B2FC2191862021cC61183087924D93',0,1,'CaoJunNFT\'s collection features four Caojun Digital Collectibles. Each collectible features one of CaoJun\'s artwork with a size of 3.5inch X 2 inch. The designs of the Cao Jun Digital Collectibles are based on three of Cao Jun\'s artworks \"Purple Pavilion and Cyan Cloud\", \"Once in a Millennium,\" and \"Spring\'s News\". The painting of \"Once in a Millennium\" was sold for HK$10.26 million at Poly Auction Hong Kong Limited in 2019. The collection of CaoJun Digital Collectible has sold for a total of US$5,374 on April 16, 2021 at Bakery Gallery.\n\nCao Jun Digital Collectible is an NFC-enabled digital wallet card powered by Pundi X and iCashRewards. The Cao Jun exclusive digital wallet card managed by XWallet can be used as a present and your own personal digital wallet. The Cao Jun exclusive digital wallet card is an easy-to-use tap card for crypto beginners. Top it up with your preferred digital currencies and pay with ease. You can also pair your Cao Jun digital wallet card onto the XWallet mobile app and use it with the iCash XPOS. There are over 800,000 XWallet registered user accounts within the Pundi X community from over 30 countries spanning across North and South America, the EU, Asia, and Australia. The XWallet can be downloaded from the App Store and Google Play.\n\nBy collecting CaoJunNFT, users can also use CaoJun NFT to farm $CJAI or iCASH and can be traded on the TSA NFT Broadway.Users are able to redeem the completed NFT for a physical digital collectible. One CaoJunNFT can be converted into one exclusive CaoJun limited edition of a digital collectible (\"CaoJun Digital Collectible\"). The total released CaoJunNFT collectibles in 2021 is 600 editions, and will be scheduled to auction from May 1, 2021 on various NFT auction platforms curated by TSA Collections.\n\nPlease contact support @teaswap.art if you have any questions.\n',NULL,NULL,NULL,NULL,'https://i.imgur.com/axIxXOQ.png','https://i.imgur.com/kzceP7D.jpg',0,NULL,'2021-06-20 06:52:38','2021-06-28 02:14:44',56,'','','','','','','','','',1,1),(263803,'56_0x919278350A7c9Da289518ac051465c949e968768','$2b$10$H5G.7cgQVy8DY5bFLSPUCO9BNO2/8MPQKM8oi/PfAAQN13SsAGVO2',NULL,NULL,'0x919278350A7c9Da289518ac051465c949e968768',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'2021-06-20 07:09:16','2021-06-20 07:09:16',56,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1),(263804,'56_0x682572eBdb1962204343e4469F924EdeaeD3b615','$2b$10$l5k8zvhWCCUUlPFApDzAieiBnVzZvHqNm6I.PvIouq/sNL8d3Eqwi','TSA test Metaverse 1',NULL,'0x682572eBdb1962204343e4469F924EdeaeD3b615',0,1,'TSA NFT Broadway Series’s theme is inspired by the Legendary Song Dynasty painting “Along the River During the Qingming Festival”, also known in Chinese as Qingming Shanghe Tu (Simplified Chinese: 清明上河图). TSA Broadway embodies the spirit of Qingming Shanghe Tu, celebrating the excitement and hopes and dreams of collaborating in a new era of NFT, all in a beautiful and artistic format.',NULL,NULL,NULL,NULL,'https://i.imgur.com/0tYPlqZ.png','https://i.imgur.com/HKn4hEo.png',0,NULL,'2021-06-20 07:32:02','2021-06-28 02:17:04',56,'','https://www.teaswap.art/nft','https://twitter.com/ArtTeaswap','https://www.instagram.com/tsa.nft/','','','','','',1,1),(263805,'56_0x3Cd95b38e6b2e3252606Ffd489a2a4DFb87F9809','$2b$10$k6DtHteIzXCfYPAOrhGv7u6mKPeQLXbX7Vtv0WIr7YJwZAyJAMoaS',NULL,NULL,'0x3Cd95b38e6b2e3252606Ffd489a2a4DFb87F9809',0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'2021-06-20 07:45:43','2021-06-20 07:45:43',56,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1),(263806,'1_0x